import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import {retorno}  from './Chat';

ReactDOM.render(
  <retorno/>,
  document.getElementById('suporte')
);

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);


